For me, it wasn‚Äôt just jumping on my bike and peddling, it was a journey. The Great Cycle Challenge is a community. Friendships were formed, there were motivational moments, sharing of cycling tricks, and the somber ride on Wednesday August 26 when we rode in solidarity for a fellow rider who was struck and killed by a vehicle. We rode, for all the kids who can‚Äôt. 

üö¥üèΩ‚Äç‚ôÄÔ∏è

I would be remiss to not thank my own support team. All of you who donated, all of you who had to endure my stories that always started with, ‚Äòthis one time on my bike...‚Äô, the bike shop who cleaned, tuned up, and fixed my bike. My super speedy beefcake riding coach who encouraged and pushed me. Along with strangers happy honking and waving from their vehicles when they saw me, all of you were there with me.

üö¥üèΩ‚Äç‚ôÄÔ∏è

